import React from 'react';
import { Players } from '../shared/ListOfDoctors';
export default function DocDetail() {
  return (
    <div className='doc'>
      <div className='container'>
        {Players.map((player) => (
          <div className='column'>
            <div className='card'>
              <img src={player.img} />
              <h3> {player.name} </h3>
              <p className='title'> {player.club} </p>
              <p><div className='content' >
              {player.info}
            </div></p>
            </div>
          </div>
        ))}
      </div>
    </div>

  );
}
